import{_ as e,c as s,o as t,aj as o}from"./chunks/framework.DPdjieCD.js";const g=JSON.parse('{"title":"常见问题 FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"cn/preface/important/question.md","filePath":"cn/preface/important/question.md"}'),i={name:"cn/preface/important/question.md"};function n(r,a,d,c,l,h){return t(),s("div",null,[...a[0]||(a[0]=[o('<h1 id="常见问题-faq" tabindex="-1">常见问题 FAQ <a class="header-anchor" href="#常见问题-faq" aria-label="Permalink to &quot;常见问题 FAQ&quot;">​</a></h1><p>这里汇总了开发者在使用 TechUI 过程中最常遇到的技术与授权问题。如果您遇到的问题未在此列出，请尝试使用 <code>tuiCoreInfo()</code> 查看详细错误代码，或联系技术支持。</p><h2 id="特殊问题" tabindex="-1">特殊问题 <a class="header-anchor" href="#特殊问题" aria-label="Permalink to &quot;特殊问题&quot;">​</a></h2><h3 id="q-为什么触发注销事件的时候-会提示告警信息。" tabindex="-1">Q: 为什么触发注销事件的时候，会提示告警信息。 <a class="header-anchor" href="#q-为什么触发注销事件的时候-会提示告警信息。" aria-label="Permalink to &quot;Q: 为什么触发注销事件的时候，会提示告警信息。&quot;">​</a></h3><p>在Prime或者Admin组件库，触发注销的时候，提示告警信息：<code>TDB: Database deletion is blocked, make sure all connections are closed !</code></p><p><strong>A: 因为Prime和Admin的导航菜单，采用了浏览器自身的<code>IndexedDB</code>数据库，如果开启了两个同地址的浏览器标签，则在注销其中一个的时候，IndexedDB数据库无法关闭连接导致的错误。</strong></p><h2 id="环境与部署" tabindex="-1">环境与部署 <a class="header-anchor" href="#环境与部署" aria-label="Permalink to &quot;环境与部署&quot;">​</a></h2><h3 id="q-生产环境报错-failed-to-load-module-script-或-wasm-加载失败" tabindex="-1">Q: 生产环境报错 <code>Failed to load module script</code> 或 Wasm 加载失败？ <a class="header-anchor" href="#q-生产环境报错-failed-to-load-module-script-或-wasm-加载失败" aria-label="Permalink to &quot;Q: 生产环境报错 `Failed to load module script` 或 Wasm 加载失败？&quot;">​</a></h3><p><strong>A: 通常是因为服务器未配置正确的 MIME 类型。</strong> TechUI 的核心依赖 <code>.wasm</code> 文件。如果您的 Web 服务器（Nginx/Apache/IIS）没有将 <code>.wasm</code> 文件的 <code>Content-Type</code> 设置为 <code>application/wasm</code>，浏览器出于安全策略将拒绝加载。</p><p><strong>解决方案：</strong></p><ul><li><strong>Nginx</strong>: 在 <code>mime.types</code> 或配置中添加：</li></ul><div class="language-nginx vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">nginx</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">types</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> {</span></span>\n<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">    application/wasm</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> wasm;</span></span>\n<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">}</span></span></code></pre></div><ul><li><strong>Apache</strong>: 在 <code>.htaccess</code> 或配置中添加：</li></ul><div class="language-apache vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">apache</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">AddType</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> application/wasm</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> .wasm</span></span></code></pre></div><h3 id="q-在-next-js-nuxt-ssr-项目中报错-window-is-not-defined" tabindex="-1">Q: 在 Next.js / Nuxt (SSR) 项目中报错 <code>window is not defined</code>？ <a class="header-anchor" href="#q-在-next-js-nuxt-ssr-项目中报错-window-is-not-defined" aria-label="Permalink to &quot;Q: 在 Next.js / Nuxt (SSR) 项目中报错 `window is not defined`？&quot;">​</a></h3><p><strong>A: TechUI 是纯客户端组件库。</strong> Wasm 核心依赖浏览器的 DOM API (<code>window</code>, <code>document</code>) 进行渲染与验证，无法在 Node.js 服务端环境中运行。 <strong>解决方案：</strong> 请确保仅在客户端加载 TechUI。例如在 Nuxt 中使用 <code>&lt;client-only&gt;</code> 标签，或在 Next.js 中使用 <code>next/dynamic</code> 并关闭 SSR。</p><h3 id="q-部署后控制台提示-hash-mismatch-或-integrity-error" tabindex="-1">Q: 部署后控制台提示 <code>Hash Mismatch</code> 或 <code>Integrity Error</code>？ <a class="header-anchor" href="#q-部署后控制台提示-hash-mismatch-或-integrity-error" aria-label="Permalink to &quot;Q: 部署后控制台提示 `Hash Mismatch` 或 `Integrity Error`？&quot;">​</a></h3><p><strong>A: 这是 CDN 缓存导致的完整性校验失败。</strong> Wasm 核心具有严格的完整性自检机制。如果您更新了版本，但 CDN 依然缓存了旧版的 <code>.wasm</code> 文件，会导致 JS加载器与 Wasm 二进制指纹不匹配。 <strong>建议：</strong> 配置服务器对 <code>.wasm</code> 文件禁用缓存，或确保构建文件名带有 Hash 值。</p><h2 id="授权与密钥" tabindex="-1">授权与密钥 <a class="header-anchor" href="#授权与密钥" aria-label="Permalink to &quot;授权与密钥&quot;">​</a></h2><h3 id="q-授权密钥-license-key-直接写在前端代码里安全吗" tabindex="-1">Q: 授权密钥 (License Key) 直接写在前端代码里安全吗？ <a class="header-anchor" href="#q-授权密钥-license-key-直接写在前端代码里安全吗" aria-label="Permalink to &quot;Q: 授权密钥 (License Key) 直接写在前端代码里安全吗？&quot;">​</a></h3><p><strong>A: 相对安全。</strong> TechUI 采用的是 <strong>“零信任”</strong> 验证架构。</p><ol><li><strong>无法隐藏</strong>：作为纯前端方案，Key 必然暴露在代码中。</li><li><strong>难以利用</strong>：Key 本身只是一个加密凭证。没有 Wasm 内部的私钥算法配合，攻击者拿到 Key 也无法生成新的授权，也无法解密核心功能。</li></ol><p>此外，如果您的实例要部署到公网环境，建议联系管理员给许可证绑定了域名，此时Key的泄露也并不会导致滥用。</p><p>默认情况下，并不会对许可证进行 <strong>域名绑定</strong> 或者 <strong>开启仅本地部署限制</strong>。</p><h3 id="q-开发许可证-过期了会发生什么" tabindex="-1">Q: 开发许可证 过期了会发生什么？ <a class="header-anchor" href="#q-开发许可证-过期了会发生什么" aria-label="Permalink to &quot;Q: 开发许可证 过期了会发生什么？&quot;">​</a></h3><p><strong>A: 系统将触发熔断。</strong> 如果您的许可证为开发许可证，请务必关注控制台的 <code>距离到期 [XX] 天</code> 提示。</p><h2 id="开发与集成" tabindex="-1">开发与集成 <a class="header-anchor" href="#开发与集成" aria-label="Permalink to &quot;开发与集成&quot;">​</a></h2><h3 id="q-为什么不支持按需引入-tree-shaking" tabindex="-1">Q: 为什么不支持按需引入 (Tree-shaking)？ <a class="header-anchor" href="#q-为什么不支持按需引入-tree-shaking" aria-label="Permalink to &quot;Q: 为什么不支持按需引入 (Tree-shaking)？&quot;">​</a></h3><p><strong>A: 基于架构与安全的权衡。</strong> TechUI 的核心是一个完整的 Wasm 二进制模块，无法像 JS 代码那样拆分。同时，全量打包也是为了保护核心算法不被逆向分析。详情请参阅 <strong>[不支持按需引入]</strong> 章节。</p><h3 id="q-我可以同时使用-base-和-scifi-两个库吗" tabindex="-1">Q: 我可以同时使用 Base 和 Scifi 两个库吗？ <a class="header-anchor" href="#q-我可以同时使用-base-和-scifi-两个库吗" aria-label="Permalink to &quot;Q: 我可以同时使用 Base 和 Scifi 两个库吗？&quot;">​</a></h3><p><strong>A: 不可以。</strong> 遵循 <strong>“单核心原则”</strong>，同一项目中严禁引入多个 TechUI 核心库，否则会导致 Wasm 上下文冲突。如果您需要两者的功能，请升级至 <strong>Prime (旗舰版)</strong>。</p><h2 id="商业与合规" tabindex="-1">商业与合规 <a class="header-anchor" href="#商业与合规" aria-label="Permalink to &quot;商业与合规&quot;">​</a></h2><h3 id="q-我购买了商业许可证-可以给我的客户分发吗" tabindex="-1">Q: 我购买了商业许可证，可以给我的客户分发吗？ <a class="header-anchor" href="#q-我购买了商业许可证-可以给我的客户分发吗" aria-label="Permalink to &quot;Q: 我购买了商业许可证，可以给我的客户分发吗？&quot;">​</a></h3><p><strong>A: 可以，但需遵循子许可规则。</strong> 商业许可证包含商业分发权。您需要在 TechUI 开发者后台为您交付的每一个客户项目生成独立的 <strong>子许可证 (Sub-License)</strong>。严禁直接将您的母许可证密钥（Master Key）交给客户。</p><p><strong>B: 其他许可证，请以客户的名义购买和生成许可</strong></p><p><strong>C: 免费版无任何限制，可以随意分发</strong></p><h3 id="q-为什么在某些国家无法使用" tabindex="-1">Q: 为什么在某些国家无法使用？ <a class="header-anchor" href="#q-为什么在某些国家无法使用" aria-label="Permalink to &quot;Q: 为什么在某些国家无法使用？&quot;">​</a></h3><p><strong>A: 地理围栏限制。</strong> 基于合规性与反诈策略，我们对缅甸、柬埔寨等特定区域进行了限制。如您的业务为当地合规企业，请联系商务申请白名单豁免。</p>',38)])])}const m=e(i,[["render",n]]);export{g as __pageData,m as default};
